  void printHorizontallyCenteredAndRemoveAfterDelay(String msg, int y, const uint32_t color_text, const uint32_t color_background, int delayTime)
  {
    tft.setTextFont(2);
    tft.setTextSize(1);
    tft.setTextDatum(MC_DATUM);
    tft.setTextColor(color_text);
    tft.drawString(msg, tft.width() / 2, 450);
    delay(delayTime);
    tft.setTextColor(color_background);
    tft.drawString(msg, tft.width() / 2, 450);
  }

